import React from "react";

const Table = ({ tableMetaData, personData }) => {
  console.log(personData);
  return (
    <div className="mt-5">
      <table className="table">
        <thead>
          <tr>
            {tableMetaData.map((x, i) => (
              <th key={i} scope="col">
                {x.headerTitle}
              </th>
            ))}
          </tr>
        </thead>
        <tbody>
          {personData.map((item, index) => (
            <tr></tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default Table;
